pragma solidity 0.5.16;
pragma experimental ABIEncoderV2;


contract SemesterStore {
  uint public year;
  mapping(uint => string) public courses;

  event CourseAdded(uint indexed number, string name);
  event CourseUpdated(uint indexed number, string name);
 
  constructor(uint _year) public {
    year = _year;
  }

  function setCourse(uint _number, string memory _name) public {
    if (bytes(courses[_number]).length == 0) {
      courses[_number] = _name;
      emit CourseAdded(_number, _name);
    } else {
      courses[_number] = _name;
      emit CourseUpdated(_number, _name);
    }
  }
}

contract StudentsStore {
  struct Student {
    string universityID;
    string name;
    string program;
    uint submissionYear;
    address[] semesters;
  }

  mapping(string => Student) private students;
 event SemesterEvent(
    string universityID,
    uint semesterIndex,
    uint year
  );

  constructor() public {
    addStudent("00001", "John Doe", "Computer Science", 2021);
    addSemester("00001", 2021);
    setCourse("00001", 0, 1, "Introduction to Computer Science");
    setCourse("00001", 0, 2, "Data Structures and Algorithms");

    addStudent("00002", "Jane Doe", "Electrical Engineering", 2022);
    addSemester("00002", 2022);
    setCourse("00002", 0, 1, "Circuit Analysis");
    setCourse("00002", 0, 2, "Electromagnetism");
  }

  function addStudent(
    string memory _universityID,
    string memory _name,
    string memory _program,
    uint _submissionYear
  ) public {
    students[_universityID] = Student({
      universityID: _universityID,
      name: _name,
      program: _program,
      submissionYear: _submissionYear,
      semesters: new address[](0)
    });
  }

  function addSemester(string memory _universityID, uint _year) public {
  Student storage student = students[_universityID];
  require(student.submissionYear <= _year, "Semester year must be after submission year");

  SemesterStore semester = new SemesterStore(_year);
  student.semesters.push(address(semester));

  // emit the SemesterEvent event when a new semester is added
  emit SemesterEvent(_universityID, student.semesters.length - 1, _year);
}

  function setCourse(
    string memory _universityID,
    uint _semesterIndex,
    uint _courseNumber,
    string memory _courseName
  ) public {
    Student storage student = students[_universityID];
    require(_semesterIndex < student.semesters.length, "Semester index out of range");

    SemesterStore semester = SemesterStore(student.semesters[_semesterIndex]);
    semester.setCourse(_courseNumber, _courseName);
  }

  function getStudent(string memory _universityID) public view returns (
    string memory,
    string memory,
    string memory,
    uint,
    address[] memory
  ) {
    Student storage student = students[_universityID];
    return (
      student.universityID,
      student.name,
      student.program,
      student.submissionYear,
      student.semesters
    );
  }
  function getAllStudents() public view returns (Student[] memory) {
  uint studentCount = 0;

  // create an array to store the student keys
  string[] memory studentKeys = new string[](1000000);

  // loop through the students mapping and store the keys in the array
  uint i = 0;
  for (i = 0; i < 1000000; i++) {
    string memory universityID = uintToString(i);
    if (bytes(students[universityID].universityID).length > 0) {
      studentKeys[studentCount] = universityID;
      studentCount++;
    }
  }

  // initialize the result array
  Student[] memory result = new Student[](studentCount);

  // loop through the student keys and populate the result array
  for (i = 0; i < studentCount; i++) {
    result[i] = students[studentKeys[i]];
  }

  return result;
}
  // utility function to convert uint to string
  function uintToString(uint v) private pure returns (string memory) {
    uint maxlength = 100;
    bytes memory reversed = new bytes(maxlength);
    uint i = 0;
    while (v != 0) {
      uint remainder = v % 10;
      v = v / 10;
      reversed[i++] = byte(uint8(48 + remainder));
    }
    bytes memory s = new bytes(i);
    for (uint j = 0; j < i; j++) {
      s[j] = reversed[i - j - 1];
    }
    if (s.length == 0) {
      return "0";
    } else {
      return string(s);
    }
  }
}
